# help function
def usage():
	print ("""Usage: %s -r <msgrate> -p <period> -i <inputfile> -o <outputfile>.
	-r <random frequency of log lines in minute> - by default 2
	-p <period in the format: 2d(2 days), 10h(10 hours), 20m(20 minutes)> - by default 1d
	-s <set predefined values to logs: CHOST|SENDER> - no by default
	-x <set expectation for predefined values 0..1> - by default 0.2
	-i <input file>
	-o <output file> - !!! Required""" %sys.argv[0])
	
	
def get_options(argv):
	msgrate = ''
	ndays = ''
	inputfile = ''
	outputfile = ''
	fields_to_set = {}
	expectation = 0.2
	try:
		opts, args = getopt.getopt(argv,"hr:p:s:x:i:o:",["rate=","period=","set=","expect=","ifile=","ofile="])
	except getopt.GetoptError:
		print ('[!!!] Incorrect input parameter!')
		usage()
		sys.exit(2)
	for opt, arg in opts:
		if opt == '-h':
			usage()
			sys.exit()
		elif opt in ("-r", "--mrate"):
			msgrate = arg
			if not re.match('\d+', msgrate):
				print ("[!!!] Msgrate of lines should be an integer.Used default value.")
				msgrate = 2  #default value
		elif opt in ("-p", "--period"):
			ndays = arg
			if not re.match('\d+[d|h|m]', ndays):
				print ("[!!!] Incorrect format of period.Used default value.")
				ndays = 24*60*1 #default value
			else:
				val = re.match('(\d+)([d|h|m])', ndays).group(1)
				key = re.match('(\d+)([d|h|m])', ndays).group(2)
				if key == 'd':
					ndays = 24*60*int(val)
				if key == 'h':
					ndays = int(val)*60
				if key == 'm':
					ndays = int(val)
		elif opt in ("-s", "--set"):
			fields_to_set_str = arg
			fields_to_set_str = fields_to_set_str.split('~~~')
			for item in fields_to_set_str:
				(k, v) = item.split('=', 2)
				fields_to_set[k] = v
		elif opt in ("-x", "--expect"):
			expectation = float(arg)

		elif opt in ("-i", "--ifile"):
			inputfile = arg
		elif opt in ("-o", "--ofile"):
			outputfile = arg
			
	return (msgrate,ndays,fields_to_set,expectation,inputfile,outputfile)

