# getting time and hour
def getTime(mdiff):

	dt = datetime.now() - timedelta(minutes=mdiff)
	ts = '{:%Y-%m-%d %H:%M:%S.%f}'.format(dt)
	hour = dt.hour
	return ts, hour
	
