users_info = None
def get_user_info(get_user):
	global users_info

	if users_info == None:
		users_info = {}
		with open(os.path.dirname(__file__) + '/../config/common/users_data.txt', 'r') as f:
			for line in f.readlines():
				user, src_ip, host, *rest = line.rstrip().split(',')

				ip_list = src_ip.split('|')

				if len(ip_list) > 1:
					weekNumber = date.today().isocalendar()[1]
					ind = weekNumber % len(ip_list)
					src_ip = ip_list[ind]

				data = {
					'src_ip': src_ip,
					'host': host
				}

				users_info[user] = data
				users_info[user.split('@')[0]] = data

	return users_info[get_user]

def get_user_ip(user):
	return get_user_info(user)['src_ip']

def get_user_host(user):
	return get_user_info(user)['host']

